CREATE DATABASE DB_Final_J5_OK
GO
USE DB_Final_J5_OK
GO
CREATE TABLE Accounts
(
	Username varchar(255) NOT NULL PRIMARY KEY,
	Password varchar(255) NOT NULL,
	Fullname nvarchar(255) NOT NULL,
	Email varchar(255) NOT NULL,
	Photo nvarchar(255) NOT NULL,
	role BIT NOT NULL,
)
GO

CREATE TABLE Categories
(
	Id char(4) not null PRIMARY KEY,
	Name nvarchar(255) NOT NULL,
	Image nvarchar(255) NOT NULL,
)

GO 

CREATE TABLE Products
(
	Id int IDENTITY(1,1) not null primary key,
	Name nvarchar(255) NOT NULL,
	Image nvarchar(255) NOT NULL,
	Price float NOT NULL,
	CreateDate Date NOT NULL,
	Available Bit NOT NULL,
	CategoryId char(4) NOT NULL foreign key references Categories(Id)
)

GO 
CREATE TABLE Orders
(
	Id bigint IDENTITY(1,1) NOT NULL PRIMARY KEY,
	Username varchar(255) NOT NULL foreign key references Accounts(Username),
	CreateDate Date NOT NULL,
	Address nvarchar(255) NOT NULL,
	IsComfirm Bit NOT NULL,
	IsPay Bit NOT NULL,
)
GO 
CREATE TABLE OrderDetails
(
	Id bigint IDENTITY(1,1) NOT NULL PRIMARY KEY,
	OrderId bigint NOT NULL FOREIGN KEY REFERENCES Orders(Id),
	ProductId int NOT NULL FOREIGN KEY REFERENCES Products(Id),
	Price float NOT NULL,
	Quantity int NOT NULL
)

GO
